import { useState,useEffect } from "react";


const Counter=()=> {
    let [count, setCount] = useState(0);

    useEffect(() => {
        let id = setInterval(() => {
            setCount(count + 1)
        }, 1000);
        return () => clearInterval(id);
    })
    return (<h1>{count}</h1>)
    
}
